class CreatePin extends StatefulWidget {
  const CreatePin({super.key});

  @override
  State<CreatePin> createState() => _CreatePinState();
}

class _CreatePinState extends State<CreatePin> {
  _displayDialog(BuildContext context) async {
    return showDialog(
        context: context,
        builder: (context) {
          return AlertDialog(
            title: const Center(child: Text('Loding .....')),
            backgroundColor: Colors.white.withOpacity(0.2),
            content: const SizedBox(
              height: 50,
              width: 50,
              child: Center(
                child: CircularProgressIndicator(color: AppColors.secondary,),
              ),
            ),
          );
        });
  }

  @override
  Widget build(BuildContext context) {
    final createPinController = TextEditingController();
    final confirmPinController = TextEditingController();
    return CommonLayout(
      hedingTitle: 'Create PIN',
      hedingSubTitle: 'You can setup PIN to login your \n account with ease!',
      body: Padding(
        padding: const EdgeInsets.symmetric(horizontal: 80.0),
        child: Column(
          children: [
            CreatePinField(
                controller: createPinController, pinHeader: 'Enter Your PIN*'),
            const SizedBox(
              height: 20.0,
            ),
            CreatePinField(
                controller: confirmPinController,
                pinHeader: 'Confirm Your PIN*'),
          ],
        ),
      ),
      bottomButton: ButtonRow(onTap: () {
        var registerBody = {
          "first_name":
              context.read<UserDetailsProvider>().userDetails.firstName,
          "last_name": context.read<UserDetailsProvider>().userDetails.lastName,
          "dial_code": context
              .read<UserDetailsProvider>()
              .userDetails
              .selectedCountryCode,
          "phone_no":
              context.read<UserDetailsProvider>().userDetails.mobileNumber,
          "uid_type":
              context.read<UserDetailsProvider>().userDetails.documentType,
          "uid": context.read<UserDetailsProvider>().userDetails.passportNumbe,
          "username":
              context.read<UserDetailsProvider>().userDetails.passportNumbe,
          "email": context.read<UserDetailsProvider>().userDetails.emailAddress,
          "nic": context.read<UserDetailsProvider>().userDetails.nicNumber,
          "password": confirmPinController.text,
          "address_line1":
              context.read<UserDetailsProvider>().userDetails.house,
          "address_line2":
              context.read<UserDetailsProvider>().userDetails.streetName,
          "city": context.read<UserDetailsProvider>().userDetails.city,
          "country": context.read<UserDetailsProvider>().userDetails.country,
          "default_language": "en",
          "user_image":
              context.read<UserDetailsProvider>().userDetails.selfieImage,
          "uid_front_img":
              "",
          "uid_back_img":
              "",
          "security_questions": [
            {"question_id": 1, "answer": "abc"},
            {"question_id": 2, "answer": "pqr"}
          ]
        };

        print(
            "EMAIL ::::${context.read<UserDetailsProvider>().userDetails.emailAddress}");
        print(
            "FIRST_NAME ::::${context.read<UserDetailsProvider>().userDetails.firstName}");
        print(
            "LAST_NAME ::::${context.read<UserDetailsProvider>().userDetails.lastName}");
        print(
            "HOUSE ::::${context.read<UserDetailsProvider>().userDetails.house}");
        print(
            "STREET_NAME ::::${context.read<UserDetailsProvider>().userDetails.streetName}");
        print(
            "CITY ::::${context.read<UserDetailsProvider>().userDetails.city}");
        print(
            "COUNTRY ::::${context.read<UserDetailsProvider>().userDetails.country}");
        print("PIN ::::${context.read<UserDetailsProvider>().userDetails.pin}");
        print(
            "PASSPORT_IMAGE ::::${context.read<UserDetailsProvider>().userDetails.passportImage}");
        print(
            "VISA IMAGE ::::::::::${context.read<UserDetailsProvider>().userDetails.visaImage}");
        print(
            "SEFIE_IMAGE ::::${context.read<UserDetailsProvider>().userDetails.selfieImage}");
        print(
            "PROFF_DOCUMENTS ::::${context.read<UserDetailsProvider>().userDetails.proofDocument}");
        print(
            "PASSPORT_NUM ::::${context.read<UserDetailsProvider>().userDetails.passportNumbe}");
        print(
            "NIC_NUM ::::${context.read<UserDetailsProvider>().userDetails.nicNumber}");
        print(
            "MOBILE_NO ::::${context.read<UserDetailsProvider>().userDetails.mobileNumber}");
        print(
            "DOCUMENT_TYPE ::::${context.read<UserDetailsProvider>().userDetails.documentType}");
        print(
            "COUNTRY_CODE ::::${context.read<UserDetailsProvider>().userDetails.selectedCountryCode}");
        print(createPinController.text);
        print(confirmPinController.text);

        Navigator.of(context).pushNamed(Routes.quickSetUpScreen);
        // context.read<UserDetails>().city;
        _displayDialog(context);
        ApiService.callApi(ApiEndpoints.registerUser, RequestType.post,
            requestBody: registerBody, errorMessages: {}).then(
          (value) {
            Navigator.of(context).pop();
            Navigator.of(context).pushNamed(Routes.quickSetUpScreen);
          },
        );

        print("CALL API::::::::::::");
      }),
    );
  }
}

class CreatePinField extends StatelessWidget {
  const CreatePinField({
    super.key,
    required this.controller,
    required this.pinHeader,
  });

  final TextEditingController controller;
  final String pinHeader;
  @override
  Widget build(BuildContext context) {
    return Column(
      children: [
        CommonText(
          text: pinHeader,
          whiteTextSize: 11.0,
          alignment: Alignment.topLeft,
        ),
        PinCodeTextField(
          controller: controller,
          appContext: context,
          length: 4,
          obscureText: true,
          obscuringCharacter: '*',
          textStyle: const TextStyle(
            color: AppColors.heddingColor,
            fontSize: 20.0,
            fontWeight: FontWeight.w600,
          ),
          hintCharacter: '-',
          hintStyle: const TextStyle(
              color: AppColors.heddingColor,
              fontSize: 20.0,
              fontWeight: FontWeight.w600),
          showCursor: true,
          keyboardType: TextInputType.number,
          pinTheme: PinTheme(
            shape: PinCodeFieldShape.underline,
            fieldHeight: 36.0,
            fieldWidth: 50.0,
            inactiveColor: AppColors.subHeddingColor,
            activeColor: AppColors.subHeddingColor,
            selectedColor: AppColors.subHeddingColor,
            disabledColor: AppColors.subHeddingColor,
          ),
          cursorHeight: 24.0,
        ),
      ],
    );
  }
}
